import React from "react";

const Services = () => {
  return (
    <div>
      <style>{`
        body {
          margin: 0;
          font-family: 'Segoe UI', sans-serif;
        }

        .services-banner {
          height: 400px;
          background-image: url('https://images.unsplash.com/photo-1581091226825-a6a2a5aee158?ixlib=rb-4.0.3&auto=format&fit=crop&w=1470&q=80');
          background-size: cover;
          background-position: center;
          background-repeat: no-repeat;
          display: flex;
          align-items: center;
          justify-content: center;
          position: relative;
          color: white;
        }

        .services-banner::before {
          content: "";
          position: absolute;
          inset: 0;
          background-color: rgba(0, 0, 0, 0.6);
        }

        .services-heading {
          position: relative;
          z-index: 1;
          font-size: 3rem;
          font-weight: bold;
        }

        .services-section {
          background-color: #f9f2ff;
          padding: 50px 20px;
          text-align: center;
        }

        .services-section h2 {
          color: #4b00b3;
          font-size: 32px;
          margin-bottom: 40px;
        }

        .services-cards {
          display: flex;
          justify-content: center;
          gap: 20px;
          flex-wrap: wrap;
        }

        .service-card {
          background-color: #f1d6f7;
          padding: 30px;
          border-radius: 16px;
          width: 300px;
          box-shadow: 0 4px 6px rgba(0,0,0,0.1);
        }

        .service-card:nth-child(3) {
          background-color: #bcb8f7;
        }

        .service-icon {
          font-size: 40px;
          margin-bottom: 20px;
        }

        .service-title {
          font-size: 20px;
          font-weight: bold;
          margin-bottom: 10px;
        }

        .service-desc {
          font-size: 15px;
          color: #444;
          margin-bottom: 15px;
        }

        .service-card ul {
          list-style-type: disc;
          padding-left: 20px;
          text-align: left;
          color: #222;
        }

        .service-card ul li {
          margin-bottom: 6px;
          font-size: 14px;
        }
      `}</style>

      {/* Banner */}
      <section className="services-banner">
        <h1 className="services-heading">Our Services</h1>
      </section>

      {/* Services */}
      <section className="services-section">
        <h2>We offer a wide range of creative services</h2>
        <div className="services-cards">

          {/* App Development */}
          <div className="service-card">
            <div className="service-icon">üì±</div>
            <div className="service-title">App Development</div>
            <div className="service-desc">
              Innovative app development services designed to create engaging, high-performance applications.
            </div>
            <ul>
              <li>Native iOS App Development</li>
              <li>Native Android App Development</li>
              <li>Cross-Platform App Development</li>
              <li>Progressive Web App Development</li>
              <li>App Testing & QA</li>
              <li>Maintenance & Upgrades</li>
            </ul>
          </div>

          {/* Web Development */}
          <div className="service-card">
            <div className="service-icon">üåê</div>
            <div className="service-title">Web Development</div>
            <div className="service-desc">
              Responsive websites with AI-powered chatbots and advanced functionality for automation.
            </div>
            <ul>
              <li>Custom Website Design & Dev</li>
              <li>AI Chatbot Integration</li>
              <li>Voice Bot Development</li>
              <li>E-commerce Development</li>
              <li>CMS & Optimization</li>
              <li>Maintenance & Support</li>
            </ul>
